import {
	Text,
	Flex,
	TableContainer,
	Tab,
	Table,
	Thead,
	Tr,
	Th,
	Tbody,
	Td,
} from '@chakra-ui/react';
import { useEffect, useState } from 'react';

export const App = () => {
	const [data, setData] = useState(null);

	const getData = () => {
		fetch('/data')
			.then((d) => d.json())
			.then((newData) => {
				const key = Object.keys(newData)[0];
				setData(newData[key]);
			});
	};
	useEffect(() => {
		getData();
	}, []);
	return (
		<Flex alignItems="center" justify="center" w="100vw" minHeight="100vh">
			<Text position="absolute" top="5vh" fontWeight="semibold" fontSize="18">
				S&P 500 Index Data
			</Text>
			{data && <DataTable data={data} />}
		</Flex>
	);
};

const DataTable = ({ data }) => {
	const columns = Object.keys(data);

	const renderRows = () => {
		console.log(columns);
		data.map((d) => {
			return (
				<Tr>
					{columns.map((c) => {
						return <Td>{data[c]}</Td>;
					})}
				</Tr>
			);
		});
	};

	const renderHeader = () => {
		columns.map((c) => {
			return <Th>{c}</Th>;
		});
	};
	return (
		<TableContainer bg="red" w="70vw">
			<Table>
				<Thead>
					<Tr>{renderHeader()}</Tr>
				</Thead>

				<Tbody>{renderRows()}</Tbody>
			</Table>
		</TableContainer>
	);
};
